import "../../../../styles/userProfile.css"
import PropTypes from "prop-types";
import { connect } from "react-redux";

import StoryCard from "../../../items/stories/Story/StoryCard";
// import MemberCard from "../../../items/users/MemberCard"

const UserProfile = () => {

    const { user } = this.props.auth;

    return (
        <section className="showcase">
            <div className="container">
                <div className="column">
                <StoryCard />
                </div>
                <div className="column">
                    <img className="vert-lines" src={require('../../../../images/Vertical Lines.png')} alt=""></img>
                </div>
                <div className="column">
                    <p className="prompt">Good evening, Kaye</p>
                    <div className="last-read">
                    </div>
                    <div className="member-card">
                        <h3>Good afternoon, {user.firstName} </h3>
                    </div>
                </div>
            </div>
        </section>
    )
};


UserProfile.propTypes = {
    logoutUser: PropTypes.func.isRequired,
    auth: PropTypes.object.isRequired
};

const mapStateToProps = state => ({
    auth: state.auth
});

export default connect(
    mapStateToProps,
)(UserProfile);
